DROP TABLE IF EXISTS `t_admin_dictionary`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_admin_dictionary` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `create_user` varchar(32) DEFAULT NULL COMMENT '创建账户id',
  `update_user` varchar(32) DEFAULT NULL COMMENT '更新账户id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `deleted` int(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除(0：正常 1：删除)',
  `version` int(11) NOT NULL DEFAULT '0' COMMENT '乐观锁',
  `code` varchar(32) NOT NULL COMMENT '字典类型',
  `name` varchar(32) NOT NULL COMMENT '字典名称',
  `pid` varchar(32) NOT NULL COMMENT '父Id',
  `desc` varchar(128) NOT NULL COMMENT '描叙',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `disable` int(1) NOT NULL DEFAULT '0' COMMENT '禁用(0-否 1-是)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='基础表--字典';
/*!40101 SET character_set_client = @saved_cs_client */;

