--
-- Table structure for table `t_admin_menu`
--

DROP TABLE IF EXISTS `t_admin_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `t_admin_menu` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `create_user` varchar(32) DEFAULT NULL COMMENT '创建账户id',
  `update_user` varchar(32) DEFAULT NULL COMMENT '更新账户id',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `deleted` int(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除(0：正常 1：删除)',
  `version` int(11) NOT NULL DEFAULT '0' COMMENT '乐观锁',
  `pid` varchar(32) NOT NULL COMMENT '指定父id',
  `name` varchar(32) NOT NULL COMMENT '菜单名',
  `two_url` varchar(128) DEFAULT NULL COMMENT '第二路由url, 前后端分离前端使用第二路由',
  `url` varchar(128) DEFAULT NULL COMMENT '菜单url',
  `icon` varchar(32) NOT NULL COMMENT '图标',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `root` int(1) NOT NULL DEFAULT '0' COMMENT '目录级别(1-系统, 2-菜单 ，3-页面, 4-按钮)',
  `disable` int(1) NOT NULL DEFAULT '0' COMMENT '禁用(0-启用 1-禁用)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='基础表--菜单';
/*!40101 SET character_set_client = @saved_cs_client */;

